import React from 'react';
import Modal from 'react-bootstrap/Modal';
import './ModalButton.css';


class ProjectButton extends React.Component {
    constructor(props, context) {
        super(props, context);

        this.handleShow = this.handleShow.bind(this);
        this.handleClose = this.handleClose.bind(this);

        this.state = {
            shows: false,
        };
    }

    handleCloses() {
        this.setState({ show: false });
    }
    handleShows() {
        this.setState({ show: true });
    }

    render() {
        return (
            <>
                <button className="WorkButton" variant="primary" onClick={this.handleShows}>
                    <h3>PROJECT</h3>
                </button>
                <div className="hejsan" show={this.state.shows} onHide={this.handleCloses}>
                    <Modal.Header closeButton>
                        <Modal.Title>Projects</Modal.Title>
                    </Modal.Header>
                    <Modal.Body className="hej">Woohoo, you're reading this text in a modal!</Modal.Body>
                </div>
            </>
        );
    }
}

export default ProjectButton;
